# @param {String[]} words
# @return {Integer[]}
def sum_prefix_scores(words)
  res = Array.new(words.size, 0)
  h = {}
  words.each do |word|
    word.size.times do |count|
      h[word[..count]] = h[word[..count]].nil? ? 1 : h[word[..count]] + 1
    end
  end
  words.each_with_index do |word, i|
    word.size.times do |count|
      res[i] += h[word[..count]]
    end
  end
  res
end

words = ["abc","ab","bc","b"]
p sum_prefix_scores words
# Output: [5,4,3,2]

words = ["abcd"]
p sum_prefix_scores words
# Output: [4]

